local color_log = client.color_log
client.color_log = function(r, g, b, ...)
    local arguments = table.concat({...})

    if arguments:find('shoppy.gg/@laff') then
        return color_log(r, g, b, '[PERFECT_YAW] Our discord server: discord.gg/luaterrorist')
    end
end

local renderer_text = renderer.text
renderer.text = function(x, y, r, g, b, a, flags, max_width, ...)
    local arguments = table.concat({...})

    if arguments:find('perfect yaw') then
        return renderer_text(x, y, r, g, b, a, flags, max_width, 'pasted yaw')
    end

    if arguments:find('laff#0075') then
        return renderer_text(x, y, r, g, b, a, flags, max_width, 'PASTED YAW | .gg/luaterrorist')
    end

    return renderer_text(x, y, r, g, b, a, flags, max_width, ...)
end

